/**
 * @typedef {string} RingState
 */

/**
 * The different states of a ring
 * @enum {RingState}
 * @category Routing
 */
const RingState = {
    WAITING: 'WAITING',
    CANCELLED: 'CANCELLED',
    EXPIRED: 'EXPIRED',
    ACCEPTED: 'ACCEPTED',
    REJECTED: 'REJECTED',
}

module.exports = RingState;
